import BaseLayout from "../components/BaseLayout";
import FoldersHeaderBar from "../components/FoldersHeaderBar";
import { Container, Row } from "react-bootstrap";

const Cudzoziemcy = () => {
  return (
    <BaseLayout title="Katalog spraw">
      <Container className="wrapper">
        <Row className="grey-box">
          <FoldersHeaderBar />
        </Row>
        <Row className="grey-box"></Row>
      </Container>
    </BaseLayout>
  );
};

export default Cudzoziemcy;
